import React, { Component } from 'react'

export class Main extends Component {
    render() {
        return (
            <div>
                <form>
                    <input type='text'></input>
                    <input type='text'></input>
                    <button>Expense</button>
                    <button>Earning</button>
                </form>
            </div>
        )
    }
}

export default Main
